import React from 'react';
import { motion } from "framer-motion";
import {summary} from './Animations';
import { NavRow } from './NavRow';
import { HRHeader } from './HRHeader';
import { HRDanger } from './HRDanger';
import vid from '../assets/received_499373587311255.mp4';

export const HRLanding = () => {
    return (
        <div>


            <HRHeader />
            <NavRow />
            <HRDanger />

            <motion.div className='summary-container' variants={summary} initial='init' animate='after'>
                <motion.div className='about-me'>
                    <motion.h2>Kia Ora! <span>(key-or-a)</span></motion.h2>
                    <motion.p> </motion.p>

                    <Player
                        playsInline
                        poster="/assets/poster.png"
                        src={vid}
                    />

                </motion.div>
            </motion.div>


        </div>
    )
}
